import './css-components/navbar.css';

function Navbar() {
	return (
		<div>
			<div className="container">
				<div className="img_wrapper">
					<img src="../assets/logos/gc-logo.png" alt="GC Logo"/>
				</div>
			</div>
		</div>
	);
}

export default Navbar;
